function initMap(){if($(".page-places .map")[0])map=new google.maps.Map($(".page-places .map")[0],{zoom:16,center:{lat:35.789581,lng:51.495528}})}var map;$(document).on("click","#places .tabs li",function(){var n=$(this),t=_.map(n.attr("data-latlng").split("|"),function(n){if(n)return new google.maps.LatLng(parseFloat(n.split(",")[0]),parseFloat(n.split(",")[1]))}),i=n.attr("data-icon"),r=n.attr("data-title");t.forEach(function(n){new google.maps.Marker({position:n,title:r,icon:i,map:map})})});setTimeout(function(){$("#places .tabs li").click()},1e3);